#   https://leetcode.com/problems/is-subsequence


class Solution:
    #   Time Limit Exceeded
    def isSubsequence0(self, s: str, t: str) -> bool:
        if (s is None or 0 == len(s)) and (t is None or 0 == len(t)):
            return True
        R, C = len(s), len(t)
        dp = [[0] * (C + 1) for _ in range(R + 1)]
        for r in range(1, R + 1):
            for c in range(1, C + 1):
                if s[r - 1] == t[c - 1]:
                    dp[r][c] = 1 + dp[r - 1][c - 1]
                else:
                    dp[r][c] = max(dp[r - 1][c], dp[r][c - 1])
        return R == dp[-1][-1]

    #   runtime; 136ms, 61.96%
    #   memory; 17.3MB, 26.67%
    def isSubsequence(self, s: str, t: str) -> bool:
        if (s is None or 0 == len(s)) and (t is None or 0 == len(t)):
            return True
        if (s is None or 0 == len(s)):
            return True
        if (t is None or 0 == len(t)):
            return False
        i, lenS = 0, len(s)
        for c in t:
            if s[i] == c:
                i += 1
            if i == lenS:
                return True
        return i == lenS


solution = Solution()
data = [('abc', 'ahbgdc', True),
        ('axc', 'ahbgdc', False),
        ('ace', 'abcde', True),
        ('aec', 'abcde', False),
        ('', 'ahbgdc', True),
        ('ahbgdc', '', False),
        ("leeeeetcode", "", True),
        ]
for s, t, expected in data:
    real = solution.isSubsequence(s, t)
    if len(t) < 20:
        print(f'{s} {t} expected {expected} real {real} result {expected == real}')
    else:
        print(f'{s} {t[:20]}... expected {expected} real {real} result {expected == real}')
